INSERT INTO `suggest` VALUES (69, '201611621407', '1.专业上改进之处：鼓励分方向教学，尤其是大二以后，计算机科学与技术这门专业，软硬件都有，专业化地教学才能让学生拥有更强的竞争力。\r\n2.课程上的改进之处：适当删除过时的科目。当前技术日新月异，不同的岗位对技术的要求完全不同。例如jsp、asp等更多是偏向后台网页开发工程师，前端开发工程师完全不会用到这些技术。\r\n3.发展方向改进之处：德智体美劳全面发展是好事，不要过度追求全面发展，术业有专攻！全面发展很容易全面平庸！职场需要有专攻之仕！');
